import React from "react";
import { Container, Row, Button } from 'react-bootstrap';
import "bootstrap/dist/css/bootstrap.min.css";

import {
    Resume2,
    Github,
    Linkedin,
  } from "./assets/img";

const Resume = () => {
    return(
        <Row id="resume">
            <Container className="resume-block d-flex justify-content-center w-100">
            <img src={Resume2}></img>
            <Button className="resume-button" src="#portfolio">Download my Resume</Button>
            </Container>

            <span className="social-icon">
                <div>
                  <a href="https://github.com/marphco" target="_blank">
                    <img id="github" src={Github} alt="GitHub" />
                  </a>
                  <a href="https:/linkedin.com/in/marco-franco"  target="_blank">
                    <img id="linkedin" src={Linkedin} alt="LinkedIn" />
                  </a>
                </div>
              </span>

        </Row>
    )
  }

export default Resume
